contract DemoAdapter1 is Ownable,  EthReceiver,ReentrancyGuard{
    using SafeMath for uint256;
     /// @notice Partner fee local pay for each swap (Use for C98 Finance only)
    uint256 public PARTNER_FEE = 80;
